import './main.css';
import React from 'react';
import { useEffect } from 'react';

function AddScript(){
    useEffect(() =>{
        const script = document.createElement("script");
        script.src = './main.js';
        script.async = true;
        document.body.appendChild(script);
    });
    return <AddScript/>
}


export default function Main(){
    const title = "메인";
    const htmlTitle = document.querySelector("title");
    htmlTitle.innerHTML = title;
    

    return(
        <>
        <div className='container'> 
            <MainTOP/>
        </div>
        </>
    );
}


function MainTOP(){
    return(
        <>
        <div className='left_div'>
            <div className='regSong_div left_border' id='regSong_btn'>
                <span className='left_span' id='regSong_span'>노래 등록</span>
            </div>
            <div className='joinMultiGame_div left_border' id='joinMultiGame'>
                <span className='left_span' id='joinMultiGame_span'>게임 참여하기</span>
            </div>
        </div>
        <script>
        document.getElementById('regSong_span').addEventListener("click", console.log('dd'))
        </script>
        </>
    );
}
